  <h1>
   G1795 ἐντυπόω
  </h1>
  <h2>
   entypóō
  </h2>
  <p>
   <em>
    (en-too-po'-o | en-too-POH-oh | ane-tyoo-POH-oh)
   </em>
  </p>
  <h3>
   Definition
  </h3>
  <p>
   from [G1722] and a derivative of [G5179]; to enstamp, i.e., engrave; engrave.
  </p>
  <ul>
   <li>
    to engrave, imprint (a figure)
   </li>
  </ul>
  <h3>
   See also
  </h3>
  <p>
   [G1722], [G5179]
  </p>
